import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomeSpace from "./HomeSpace";
import JoinSpace from "./JoinSpace";
import LoginSpace from "./LoginSpace";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomeSpace />} index />
        <Route path="JoinSpace" element={<JoinSpace />} />
        <Route path="LoginSpace" element={<LoginSpace />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
